import React from "react";
import { Link } from "react-router-dom";
import HipHop from "./../../assets/hiphop.mp4";
import "./headStyles.css";

function heading() {
  return (
    <div>
      <a href="#" class="btn-mix-noborder" data-text="color">
        color
      </a>
      <a href="#" class="btn-mix" data-text="codepen">
        codepen
      </a>
      <a href="#" class="btn-mix-noRadius" data-text="marco">
        marco
      </a>
    </div>
  );
}
export default heading;
